import React, { Component } from 'react';
import LoginCreate from './login/LoginCreate';
import Headers from '../common/headers';

//For Others route calling this layout
class Layou extends Component {
  render() {
    return (
      <>
        <Headers />
        {this.props.children}
        <LoginCreate />
      </>
    );
  }
}

export default Layou;
